import React, { useState } from "react";
import axios from "axios";
import Sidebar from "../Sidebar";
import Header from "../Header";
import Footer from "../Footer";

const AddSubject = () => {
  const [formData, setFormData] = useState({
    courseName: "",
    courseDescription: "",
    price: "",
    tag: "",
    availableInstructors: [], // Assuming you'll select instructors from a list later
    thumbnail: "",
    whatYouWillLearn: "",
    courseContent: "",
    instructions: "",
    status: "active", // Default status
  });

  const [error, setError] = useState("");
  const [successMessage, setSuccessMessage] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const token = localStorage.getItem("authToken"); // Assume token is stored here after login

      const response = await axios.post(
        "http://localhost:4000/api/v1/courses/add",
        formData,
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );

      setSuccessMessage("Course added successfully!");
      setFormData({
        courseName: "",
        courseDescription: "",
        price: "",
        tag: "",
        availableInstructors: [],
        thumbnail: "",
        whatYouWillLearn: "",
        courseContent: "",
        instructions: "",
        status: "active",
      });
      setError("");
    } catch (error) {
      setError(
        error.response?.data?.message || "An error occurred while adding the course."
      );
    }
  };

  return (
    <div className="flex h-screen bg-gray-100 overflow-hidden">
      <Sidebar />

      <div className="flex-1 flex flex-col overflow-hidden">
        <Header />

        <main className="flex-1 overflow-x-hidden overflow-y-auto bg-gray-200 p-4">
          <div className="container mx-auto max-w-7xl">
            <div className="mb-6">
              <h1 className="text-2xl font-semibold">Add New Course</h1>
              <p className="text-sm text-gray-600">
                Fill in the form below to add a new course.
              </p>
            </div>

            {error && <p className="text-red-500">{error}</p>}
            {successMessage && <p className="text-green-500">{successMessage}</p>}

            <form
              onSubmit={handleSubmit}
              className="bg-white shadow-md rounded-lg p-6 space-y-4"
            >
              <div className="flex flex-col">
                <label htmlFor="courseName" className="text-gray-600 text-sm mb-1">
                  Course Name
                </label>
                <input
                  type="text"
                  id="courseName"
                  name="courseName"
                  value={formData.courseName}
                  onChange={handleChange}
                  placeholder="Enter course name"
                  className="border border-gray-300 rounded-lg p-2"
                  required
                />
              </div>

              <div className="flex flex-col">
                <label htmlFor="courseDescription" className="text-gray-600 text-sm mb-1">
                  Course Description
                </label>
                <textarea
                  id="courseDescription"
                  name="courseDescription"
                  value={formData.courseDescription}
                  onChange={handleChange}
                  placeholder="Enter course description"
                  className="border border-gray-300 rounded-lg p-2"
                  required
                />
              </div>

              <div className="flex flex-col">
                <label htmlFor="price" className="text-gray-600 text-sm mb-1">
                  Price
                </label>
                <input
                  type="number"
                  id="price"
                  name="price"
                  value={formData.price}
                  onChange={handleChange}
                  placeholder="Enter price"
                  className="border border-gray-300 rounded-lg p-2"
                  required
                />
              </div>

              <div className="flex flex-col">
                <label htmlFor="tag" className="text-gray-600 text-sm mb-1">
                  Tag
                </label>
                <input
                  type="text"
                  id="tag"
                  name="tag"
                  value={formData.tag}
                  onChange={handleChange}
                  placeholder="Enter tag"
                  className="border border-gray-300 rounded-lg p-2"
                  required
                />
              </div>

              {/* Add additional form fields as needed */}
              {/* Example: Instructors, Thumbnail, WhatYouWillLearn, etc. */}

              <button
                type="submit"
                className="bg-blue-600 text-white py-2 px-4 rounded-lg hover:bg-blue-700 transition"
              >
                Add Course
              </button>
            </form>
          </div>
        </main>

        <Footer />
      </div>
    </div>
  );
};

export default AddSubject;
